import React from 'react';

const h = React.createElement;


export default function ProgressBar(step){

    React.useEffect(() => {
        let steps= [0,1,2,3,4];

        },);


        return h("div", {className:"ProgressBar"},
        <RenderProgress step = {step} steps = {steps}/>
        );


    }

    function RenderProgress(step, steps){
        return h("span", {}, steps.forEach(val => {
            if (val === step){return <span classname="currentstep"></span>};
            return (<span classname="notcurrentstep"></span>);
        }))
    }
